import LogicManager from "../businesslogic/LogicManager";
import { useState, useEffect } from "react";


const SettingPage = ({setError}) => {
    const [userList, setUserList] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const loadUsers = async () => {
            const ret = await LogicManager.getInstance().getUserManager().loadUserList();
            if (ret.length == 0) {
                setError(1);
            }
            console.log(ret);
            
            return ret;
        }

        setUserList(loadUsers());
        setLoading(false);
    }, []);

    return <div>
        <div className='usersList'>
            {loading ? <div>Caricamento</div> : userList.map(usr => (<div>
                <div>usr.getUserName()</div>
                <div>usr.getIsAdmin()</div>
            </div>))}
        </div>
    </div>
}

export default SettingPage;
